int a[(int) 1e6 + 5];

int main() {
    ios_base::sync_with_stdio(false);
    cin.tie(0);
    cout.tie(0);

    int n, k;
    cin >> n >> k;
    for(int i = 1; i <= n; i++) {
        cin >> a[i];
    }

    deque<int> dq;
    for(int i = 1; i <= n; i++) {
        while(!dq.empty() && dq.front() <= i - k) dq.pop_front();
        while(!dq.empty() && a[dq.back()] >= a[i]) dq.pop_back();
        dq.push_back(i);
        if (i >= k) {
            cout << a[dq.front()] << '\n';
        }
    }
}
